import { getPhotos, deletePhoto, APIURL } from "./requests";
class HomePage extends React.Component {

    constructor() {
        super()
        this.state = {
            photos: []
        }
    }
    componentDidMount() {
        const response = getPhotos();
        console.log('fpgog', response.data)
    }

    render() {

        console.log(this.state.photos)


        return (
            <div className="container">
